import { games } from './games'


export const generateNewGame = () => {
    return (dispatch) => {
        dispatch(ui.actions.setLoading(true))
        fetch('')
                .then(res => res.json())
                .then(data => {
                    console.log(data)
                    dispatch(games.actions.generateGame(data))
                    dispatch(ui.actions.setLoading(false))
                })
    }
}

